import {CUSTOM_ELEMENTS_SCHEMA, NgModule} from '@angular/core';
import {RouterModule} from '@angular/router';

export const PROFESSIONAL = 'professional';
export const SEARCH_HISTORY = 'search-history';
export const PRFESSIONAL_HISTORY = 'professional-history';
export const HISTORY = 'history';

@NgModule({
    imports: [
        RouterModule.forChild([
            {
                path: PROFESSIONAL,
                loadChildren: function() { return new Promise(function (resolve, reject) {  (require as any).ensure([], function (require: any) {    resolve(require('./professional/professional.module')['EdmsProfessionalModule']);  }, function(e: any) {    reject({ loadChunkError: true, details: e });  });}) }
            },
            {
                path: SEARCH_HISTORY,
                loadChildren: function() { return new Promise(function (resolve, reject) {  (require as any).ensure([], function (require: any) {    resolve(require('./search-history/search-history.module')['EdmsSearchHistoryModule']);  }, function(e: any) {    reject({ loadChunkError: true, details: e });  });}) }
            },
            {
                path: PRFESSIONAL_HISTORY,
                loadChildren: function() { return new Promise(function (resolve, reject) {  (require as any).ensure([], function (require: any) {    resolve(require('./professional-history/professional-history.module')['EdmsProfessionalHistoryModule']);  }, function(e: any) {    reject({ loadChunkError: true, details: e });  });}) }
            },
            {
                path: HISTORY,
                loadChildren: function() { return new Promise(function (resolve, reject) {  (require as any).ensure([], function (require: any) {    resolve(require('./history/history.module')['EdmsHistoryModule']);  }, function(e: any) {    reject({ loadChunkError: true, details: e });  });}) }
            }

            /* jhipster-needle-add-entity-route - JHipster will add entity modules routes here */
        ])
    ],
    entryComponents: [],
    providers: [],
    schemas: [CUSTOM_ELEMENTS_SCHEMA]
})
export class EdmsEntityModule {
}
